import React from "react";
import styles from "./Header.module.css"

const Header = () => {
    return (
        <header className={styles["header"]}>
            <div className={styles["header-content"]}>
                <a href="index.html" className={styles["header-logo"]}> CineMAX </a>
            </div>
            <form>
                <input type="text" className={styles["header-search"]} placeholder="search" />
            </form>
        </header>
    )
}

export default Header;
